function getCookieVal(offset) {
  var endstr = document.cookie.indexOf (";", offset)
  if (endstr == -1) endstr = document.cookie.length
  return unescape(document.cookie.substring(offset, endstr))
}

function AddCookie(name, value) {
  expires=new Date()
  expires.setTime(Date.parse("Dec 31, 2999 18:59:59"))
  document.cookie = name + "=" + escape (value) + "; expires=" + expires.toGMTString()
}

function GetCookie(name) {
  var arg = name + "="
  var alen = arg.length
  var clen = document.cookie.length
  var i = 0
  while (i < clen) {
    var j = i + alen
    if (document.cookie.substring(i,j ) == arg) return getCookieVal (j)
    i = document.cookie.indexOf(" ", i) + 1
    if (i == 0) break
    }
  return null
}

function DeleteCookie(name) {
  var exp = new Date()
  exp.setTime (exp.getTime() - 1)
  var cval = GetCookie (name)
  document.cookie = name + "=" + cval + "; expires=" + exp.toGMTString()
}

function LogIt(Field){
//  AddCookie("fName", form.fName.value);
//  document.writeln(GetCookie("fName");

function PuzzleObj() {
  this.Letter = ""
  this.Neighbors = new Array()
}

function NeighborTo(i,j,Mode){
  var Result = true
  if (i==j) Result=false
  var iCol = i % Mode
  var jCol = j % Mode
  if (Math.abs(iCol - jCol) > 1 ) Result=false
  var iRow = Math.floor(i/Mode)
  var jRow = Math.floor(j/Mode)
  if ( Math.abs(iRow - jRow) > 1 ) Result=false
  return Result
}

function BuildPuzzleObj(){
  if (NoCrap()) {
    var Puzzle=document.frmAsst5.txtPuzzle.value
    var PLength=Puzzle.length
    var Mode=Math.sqrt(Puzzle.length)
    var Letters = new Array
    objPuzzle.length=PLength
    for (var i=0; i<PLength; i++) {
      Letters[i]=Puzzle.charAt(i)
    }
    for (var i=0; i<PLength; i++) {
      objPuzzle[i] = new PuzzleObj() 
      objPuzzle[i].Letter = Letters[i]
      for (var j=0; j<PLength; j++) {
        if (NeighborTo(i,j,Mode)) objPuzzle[i].Neighbors.push(j)
      }
    }
  }
  else {
    alert("REMOVE ALL NON-ALPHA CHARACTERS FROM PUZZLE TEXTBOX")
    //document.frmAsst5.txtPuzzle.focus()
    //document.frmAsst5.txtPuzzle.select()
  }
}

function bIn(theArray, theElement) {
  var Result = false
  var minIndex = 0
  var maxIndex = theArray.length - 1
  var currentIndex
  var currentElement
  var Finished = false
  do {
    currentIndex = (minIndex + maxIndex) / 2 | 0
    currentElement = theArray[currentIndex]
    if (currentElement < theElement) {
      minIndex = currentIndex + 1
    }
    else if (currentElement > theElement) {
           maxIndex = currentIndex - 1
         }
         else {
           Result = true
         }
    if (Result==true) Finished = true
    if (minIndex > maxIndex) Finished = true
  } while (!Finished)
  return Result
}

function IsValidWord(Temp) {
  var Result = true
  var DictLetter = Temp.charAt(0)
  eval("if (!bIn(" + DictLetter + "Dictionary, Temp)) Result=false") 
  return Result
}

function AllUnique(IDs) {
  var Result = true
  for (var i in IDs) {
    for (var j in IDs) {
      if ((IDs[i]==IDs[j]) && (i!=j)) Result=false
    }
  }
  return Result
}

function PopOrder(Result) {

  function SolutionObj() {
    this.Word = ""
    this.Reps = 0
  }

  function ByReps(value1, value2){
    if (value1.Reps > value2.Reps) return -1;
    if (value1.Reps < value2.Reps) return 1;
    if (value1.Reps == value2.Reps) return 0;
  }

  var Msg = Result.split(": ")
  //alert("*" + Msg[0] + "*")
  //alert("*" + Msg[1] + "*")
  Result = Msg[0] + ": "
  var WNum = Msg[1].length-1
  var Words=Msg[1].substring(0,WNum)
  //alert("*"+Words+"*")
  var Solutions = Words.split(" ")
  var objSolutions = new Array
  objSolutions.length = Solutions.length
  //alert(objSolutions.length)
  for (var i in Solutions) {
    objSolutions[i] = new SolutionObj()
    objSolutions[i].Word=Solutions[i]
//    var Test = GetCookie(Solutions[i])
//    alert(Test)
    if(GetCookie(Solutions[i]) != null) {
      objSolutions[i].Reps = parseInt(GetCookie(Solutions[i]))
    }
  }
  objSolutions.sort(ByReps)
  // PopSelect(objSolutions)
  for (var i in objSolutions) {
    Result+= objSolutions[i].Word + ":" + objSolutions[i].Reps + " "
  }
  return(Result)
}

function WrapItUp(Start, Result) {
  if (!NoCrap()) {
    alert("REMOVE ALL NON-ALPHA CHARACTERS FROM PUZZLE TEXTBOX")
    Result="Results Here"
  }
  else {
    //Result = PopOrder(Result)
    var Finish = new Date()
    window.status="WORK FINISHED: " + DOW(Finish.getDay()) + ":" + Finish.getHours() + ":" + Finish.getMinutes() + ":" + Finish.getSeconds()
    Result += "\n\nSTART: " + DOW(Start.getDay()) + ":" + Start.getHours() + ":" + Start.getMinutes() + ":" + Start.getSeconds() +"\n"
    Result += "FINISH: " + DOW(Finish.getDay()) + ":" + Finish.getHours() + ":" + Finish.getMinutes() + ":" + Finish.getSeconds() + "\n"
    var Elapsed = Math.round((Finish.getTime() - Start.getTime())/600)/100;
    Result += "TOTAL MINUTES ELAPSED: " + Elapsed + "\n"  
  }
  return Result
}

function Go2(Neighbors,WordsOnly) {
  var Start = new Date()
  window.status="WORK STARTING: " + DOW(Start.getDay()) + ":" + Start.getHours() + ":" + Start.getMinutes() + ":" + Start.getSeconds()
  var PLength=objPuzzle.length

  for (Index=0; Index<PLength; Index++) {
    eval("var ChkBox = document.frmAsst5.chk" + objPuzzle[Index].Letter)
    if (ChkBox.checked) {
      if (Neighbors==true) {
        for (JIndex in objPuzzle[Index].Neighbors) {    
          var JID = objPuzzle[Index].Neighbors[JIndex]
          var Selected=Result.split(" ")
          Selected.sort()
          var Temp = objPuzzle[Index].Letter + objPuzzle[JID].Letter
          var IDs = new Array(Index,JID)
          if (AllUnique(IDs)) {

              if (IsValidWord(Temp)) Result += Temp + " "
            }
          }

      else {
        var Puzzle=document.frmAsst5.txtPuzzle.value
        if (Puzzle.indexOf("X")>-1) PLength=Puzzle.indexOf("X")
        else PLength=Puzzle.length
        for (JIndex=0; JIndex<PLength; JIndex++) {
          var Selected=Result.split(" ")
          Selected.sort()
          var Temp = objPuzzle[Index].Letter + objPuzzle[JIndex].Letter
          var IDs = new Array(Index,JIndex)
          if (AllUnique(IDs)) {
            if (!bIn(Selected, Temp)) {
              if (WordsOnly) {                    
                if (IsValidWord(Temp)) Result += Temp + " "
              }
              else {
                Result += Temp + " "
              }
            }
          }
        }
      }
    }
  }
  Result=WrapItUp(Start,Result)
  return Result
}

              }
            }
          }
        }
      }
    }
  }
  Result=WrapItUp(Start,Result)
  return Result
}

function Go8(Neighbors,WordsOnly) {
  var Start = new Date()
  window.status="WORK STARTING: " + DOW(Start.getDay()) + ":" + Start.getHours() + ":" + Start.getMinutes() + ":" + Start.getSeconds()
  var PLength=objPuzzle.length
  var Result = 'Try these 8 letter words: '
  for (Index=0; Index<PLength; Index++) {
    eval("var ChkBox = document.frmAsst5.chk" + objPuzzle[Index].Letter)
    if (ChkBox.checked) {
      if (Neighbors==true) {
        for (JIndex in objPuzzle[Index].Neighbors) {    
          var JID = objPuzzle[Index].Neighbors[JIndex]
          for (KIndex in objPuzzle[JID].Neighbors) {
            var KID = objPuzzle[JID].Neighbors[KIndex]
            for (LIndex in objPuzzle[KID].Neighbors) {
              var LID = objPuzzle[KID].Neighbors[LIndex]
              for (MIndex in objPuzzle[LID].Neighbors) {
                var MID = objPuzzle[LID].Neighbors[MIndex]
                for (NIndex in objPuzzle[MID].Neighbors) {
                  var NID = objPuzzle[MID].Neighbors[NIndex]
                  for (OIndex in objPuzzle[NID].Neighbors) {
                    var OID = objPuzzle[NID].Neighbors[OIndex]
                    for (PIndex in objPuzzle[OID].Neighbors) {
                      var PID = objPuzzle[OID].Neighbors[PIndex]
                      var Selected=Result.split(" ")
                      Selected.sort()
                      var Temp = objPuzzle[Index].Letter + objPuzzle[JID].Letter + objPuzzle[KID].Letter + objPuzzle[LID].Letter + objPuzzle[MID].Letter + objPuzzle[NID].Letter + objPuzzle[OID].Letter + objPuzzle[PID].Letter
                      var IDs = new Array(Index,JID,KID,LID,MID,NID,OID,PID)
                      if (AllUnique(IDs)) {
                        if (!bIn(Selected, Temp)) {
                          if (IsValidWord(Temp)) Result += Temp + " "
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
      else {
        var Puzzle=document.frmAsst5.txtPuzzle.value
        if (Puzzle.indexOf("X")>-1) PLength=Puzzle.indexOf("X")
        else PLength=Puzzle.length
        for (JIndex=0; JIndex<PLength; JIndex++) {
          for (KIndex=0; KIndex<PLength; KIndex++) {
            for (LIndex=0; LIndex<PLength; LIndex++) {
              for (MIndex=0; MIndex<PLength; MIndex++) {
                for (NIndex=0; NIndex<PLength; NIndex++) {                
                  for (OIndex=0; OIndex<PLength; OIndex++) {
                    for (PIndex=0; PIndex<PLength; PIndex++) {
                      var Selected=Result.split(" ")
                      Selected.sort()
                      var Temp = objPuzzle[Index].Letter + objPuzzle[JIndex].Letter + objPuzzle[KIndex].Letter + objPuzzle[LIndex].Letter + objPuzzle[MIndex].Letter + objPuzzle[NIndex].Letter + objPuzzle[OIndex].Letter + objPuzzle[PIndex].Letter
                      var IDs = new Array(Index,JIndex,KIndex,LIndex,MIndex,NIndex,OIndex,PIndex)
                      if (AllUnique(IDs)) {
                        if (!bIn(Selected, Temp)) {
                          if (WordsOnly) {                    
                            if (IsValidWord(Temp)) Result += Temp + " "
                          }
                          else {
                            Result += Temp + " "
                          }
                        }
                      }
                    }
                  }  
                }
              }
            }
          }
        }
      }
    }
  }
  Result=WrapItUp(Start,Result)
  return Result
}

function CleanArray(DirtyArr) {
  var ECount=0
  for (var i=0; i<DirtyArr.length; i++) {
    var Wordlen = DirtyArr[i].length
    if (DirtyArr[i].charCodeAt(0) == 13) {
      DirtyArr[i] = DirtyArr[i].substring(1, Wordlen)
    }
    if (DirtyArr[i].charCodeAt(0) == 10) {
      DirtyArr[i] = DirtyArr[i].substring(1, Wordlen)
    }
    if (DirtyArr[i].charCodeAt(Wordlen-1) == 10) {
      DirtyArr[i] = DirtyArr[i].substring(0, Wordlen-1)
    }
    if (DirtyArr[i].charCodeAt(Wordlen-1) == 13) {
      DirtyArr[i] = DirtyArr[i].substring(0, Wordlen-1)
    }
  }
}

function EqualArrays(Arr1, Arr2) {
  var Result = true
  var ErrCnt=0
  if (Arr1.length != Arr2.length) Result=false
  for (var i=0; i<Arr1.length; i++) {
    if (Arr1[i]!=Arr2[i]) {
      Result=false
      ErrCnt++
    }
    if (ErrCnt==1) alert(i + " : " + Arr1[i] + " : " + Arr2[i])
  }
  return Result
}

function ArrayErrors(Arr1, Arr2) {
  var ErrorCount = 0
  if (Arr1.length != Arr2.length) Result=false
  for (var i=0; i<Arr1.length; i++) {
    if (Arr1[i]!=Arr2[i]) ErrorCount++
  }
  return ErrorCount
}
